  constructor(props) {
    super(props);
    console.log(props.item);
  }
  state = {};
  componentDidMount = () => {
    axios.get("/products").then(res => {
      result.innerHTML = res.data
        .map(cat => {
          return `
                    <h2>${cat.name} ${cat.id}</h2>
                `;
        })
        .join(" ");
    });
  };
  render() {
    return (
      <div>
        headphones
        {/* {productId} */}
      </div>
    );
  }
}

